    false,nt"url": null,nt"notes": "These data are stacked multichannel marine
    seismic reflection data recorded during the 1987 field season in the Ross Sea, Antarctica,
    by SEVMORGEOLOGIA, RUSSIA. The following data types are included for each line:
    computer display images, location maps, and the digital seismic data. Software is
    provided to view the images, to plot selected portions of the data to the screen,
    and to convert the data into SEG-Y formation. The CD-ROM was produced in accordance
    with the ISO 9660 Standard. The display software runs only under DOS. All text files
    are in ASCII format.",nt"license_title": null,nt"extras": [{ntt"key":
